import React, { useState } from 'react';
import './style.css';  // Import the CSS file
import Question from './Question';

export function Java() {
    const javaQuestions = [
        {
            qno: 'Q.1-)',
            quest: 'Memory occupied by char variable is ?',
            optA: '1 byte',
            optB: '8 byte',
            optC: '2 byte',
            optD: '4 byte',
            corrans: 'C'
        },
        {
            qno: 'Q.2-)',
            quest: 'Memory occupied by int variable is ?',
            optA: '1 byte',
            optB: '8 byte',
            optC: '2 byte',
            optD: '4 byte',
            corrans: 'D'
        },
        {
            qno: 'Q.3-)',
            quest: 'Which of these is not a primitive data type?',
            optA: 'int',
            optB: 'Float',
            optC: 'boolean',
            optD: 'char',
            corrans: 'B'
        },
        {
            qno: 'Q.4-)',
            quest: 'Which method can be used to find the length of a string in Java?',
            optA: 'getSize()',
            optB: 'length()',
            optC: 'getLength()',
            optD: 'size()',
            corrans: 'B'
        },
        {
            qno: 'Q.5-)',
            quest: 'Which keyword is used to create a subclass in Java?',
            optA: 'super',
            optB: 'this',
            optC: 'extends',
            optD: 'class',
            corrans: 'C'
        }
    ];

    const [showQuestions, setShowQuestions] = useState(false);

    return (
        <div className="container">
            <div className="title">Java Content</div>
            <button type='button' onClick={() => setShowQuestions(true)} className="button">Show Java Questions</button>
            {showQuestions && (
                <form>
                    {javaQuestions.map((q, index) => (
                        <div key={index} className="question">
                            <p>{q.qno} {q.quest}</p>
                            <div className="options">
                                <label>A. {q.optA}</label>
                                <label>B. {q.optB}</label>
                                <label>C. {q.optC}</label>
                                <label>D. {q.optD}</label>
                            </div>
                        </div>
                    ))}
                    <button type='submit' className="button">Submit Question</button>
                </form>
            )}
        </div>
    );
}

export function Sql() {
    const sqlQuestions = [
        {
            qno: 'Q.1-)',
            quest: 'Which SQL statement is used to extract data from a database?',
            optA: 'GET',
            optB: 'OPEN',
            optC: 'SELECT',
            optD: 'EXTRACT',
            corrans: 'C'
        },
        {
            qno: 'Q.2-)',
            quest: 'Which SQL statement is used to update data in a database?',
            optA: 'MODIFY',
            optB: 'UPDATE',
            optC: 'SAVE',
            optD: 'ALTER',
            corrans: 'B'
        },
        {
            qno: 'Q.3-)',
            quest: 'Which function is used to count the number of rows in a SQL query?',
            optA: 'COUNT()',
            optB: 'SUM()',
            optC: 'NUMBER()',
            optD: 'TOTAL()',
            corrans: 'A'
        },
        {
            qno: 'Q.4-)',
            quest: 'Which SQL clause is used to filter records?',
            optA: 'GROUP BY',
            optB: 'ORDER BY',
            optC: 'WHERE',
            optD: 'HAVING',
            corrans: 'C'
        },
        {
            qno: 'Q.5-)',
            quest: 'Which command is used to delete a table from a database?',
            optA: 'REMOVE TABLE',
            optB: 'DROP TABLE',
            optC: 'DELETE TABLE',
            optD: 'CLEAR TABLE',
            corrans: 'B'
        }
    ];

    const [showQuestions, setShowQuestions] = useState(false);

    return (
        <div className="container">
            <div className="title">Sql Content</div>
            <button type='button' onClick={() => setShowQuestions(true)} className="button">Show SQL Questions</button>
            {showQuestions && (
                <form>
                    {sqlQuestions.map((q, index) => (
                        <div key={index} className="question">
                            <p>{q.qno} {q.quest}</p>
                            <div className="options">
                                <label>A. {q.optA}</label>
                                <label>B. {q.optB}</label>
                                <label>C. {q.optC}</label>
                                <label>D. {q.optD}</label>
                            </div>
                        </div>
                    ))}
                    <button type='submit' className="button">Submit Question</button>
                </form>
            )}
        </div>
    );
}

export function Html() {
    const htmlQuestions = [
        {
            qno: 'Q.1-)',
            quest: 'What does HTML stand for?',
            optA: 'Hyper Text Markup Language',
            optB: 'Hyperlinks and Text Markup Language',
            optC: 'Home Tool Markup Language',
            optD: 'Hyperlinking Text Management Language',
            corrans: 'A'
        },
        {
            qno: 'Q.2-)',
            quest: 'Who is making the Web standards?',
            optA: 'Mozilla',
            optB: 'Microsoft',
            optC: 'Google',
            optD: 'The World Wide Web Consortium',
            corrans: 'D'
        },
        {
            qno: 'Q.3-)',
            quest: 'Choose the correct HTML element for the largest heading:',
            optA: '<h1>',
            optB: '<heading>',
            optC: '<h6>',
            optD: '<head>',
            corrans: 'A'
        },
        {
            qno: 'Q.4-)',
            quest: 'What is the correct HTML element for inserting a line break?',
            optA: '<br>',
            optB: '<lb>',
            optC: '<break>',
            optD: '<ln>',
            corrans: 'A'
        },
        {
            qno: 'Q.5-)',
            quest: 'Which character is used to indicate an end tag?',
            optA: '*',
            optB: '/',
            optC: '!',
            optD: '\\',
            corrans: 'B'
        }
    ];

    const [showQuestions, setShowQuestions] = useState(false);

    return (
        <div className="container">
            <div className="title">Html Content</div>
            <button type='button' onClick={() => setShowQuestions(true)} className="button">Show HTML Questions</button>
            {showQuestions && (
                <form>
                    {htmlQuestions.map((q, index) => (
                        <div key={index} className="question">
                            <p>{q.qno} {q.quest}</p>
                            <div className="options">
                                <label>A. {q.optA}</label>
                                <label>B. {q.optB}</label>
                                <label>C. {q.optC}</label>
                                <label>D. {q.optD}</label>
                            </div>
                        </div>
                    ))}
                    <button type='submit' className="button">Submit Question</button>
                </form>
            )}
        </div>
    );
}
